import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.setItem('logindash', false);
    navigate('/');
  };

  // Conditionally navigate to '/' when 'logindash' is 'false'
  if (localStorage.getItem('logindash') === false) {
    return navigate('/'); // You can return null if you don't want to render anything
  }

  return (
    <div>
      <p>sara</p>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
}
